void rssi2file(uint8_t phong, double *rssi){
    FILE *fptr;
    char phong_str[20];

    sprintf(phong_str, "phong_%d.txt", phong);
    printf("%s\n", phong_str);

    fptr = fopen(phong_str,"a");

    if(fptr == NULL)
    {
      printf("Error!");   
      exit(1);             
    }
    
    fprintf(fptr,"{%.0lf, %.0lf, %.0lf, %.0lf, %.0lf}, \n",\
            rssi[0], rssi[1], rssi[2], rssi[3], rssi[4]);
    
    fclose(fptr);
}



