void process_receive_data(frame_struct_t *receive){

    switch(receive->state){

        case STATE_BEGIN:
            PRINTF("STATE_BEGIN\n");
            process_begin(receive);            
            break;
            
        case STATE_NORMAL:
            PRINTF("STATE_NORMAL\n");
            node_alt.emergency = 'N';
            memcpy(&node_alt.last_data_receive, receive, MAX_LEN);
            node_alt.num_receive++;
            node_alt.last_seq = receive->seq;
            break;

        case STATE_EMERGENCY:
            PRINTF("STATE_EMERGENCY\n");
            process_emergency(receive);
            PRINTF("STATE_EMERGENCY_END_\n");
            break;

        default:
            break;
    }

}

void process_emergency(frame_struct_t *receive){
    uint8_t emergency_node_addr[25];
    uint32_t seq;
    seq = 0;
    if (receive->cmd != RSSI_COLLECT){
        sprintf(emergency_node_addr, "%02x%02x::%02x%02x:%02x%02x:%02x%02x:%02x%02x", 
            (int)receive->ipv6_dest_addr[0], (int)receive->ipv6_dest_addr[1],
            (int)receive->ipv6_dest_addr[8], (int)receive->ipv6_dest_addr[9],
            (int)receive->ipv6_dest_addr[10], (int)receive->ipv6_dest_addr[11],
            (int)receive->ipv6_dest_addr[12], (int)receive->ipv6_dest_addr[13],
            (int)receive->ipv6_dest_addr[14], (int)receive->ipv6_dest_addr[15]);
        PRINTF("EMEMRGENCY ADDR: %s\n", emergency_node_addr);
        emergency_node_pos = check_end_device_list(&emergency_node_addr[0]);
        PRINTF("POSITION EMEMRGENCY NODE: %d\n", emergency_node_pos);
        seq = ((uint32_t)receive->payload_data[2]) | ((uint32_t) receive->payload_data[3] << 8);
        seq = seq | ((uint32_t) receive->payload_data[4] << 16);
        seq = seq | ((uint32_t) receive->payload_data[5] << 24);
        switch (end_device[emergency_node_pos].emergency){
            case 'N':
                end_device[emergency_node_pos].emergency = 'Y';
                time (&current_time);
                memcpy(&end_device[emergency_node_pos].timer, &current_time, sizeof(time_t)); 
                timeinfo = localtime ( &end_device[emergency_node_pos].timer );
                printf ( "time and date: %s\n", asctime (timeinfo) );
                end_device[emergency_node_pos].RSSI[router_pos] = receive->payload_data[1];
                end_device[emergency_node_pos].last_seq = seq; 
                PRINTF ("sequence:  %d\n", end_device[emergency_node_pos].last_seq);
                break;

            case 'Y':
                PRINTF("___YES____\n");
                if(seq == end_device[emergency_node_pos].last_seq)
                    end_device[emergency_node_pos].RSSI[router_pos] = receive->payload_data[1];
                else if(seq > end_device[emergency_node_pos].last_seq){
                    time (&current_time);
                    memcpy(&end_device[emergency_node_pos].timer, &current_time, sizeof(time_t)); 
                    end_device[emergency_node_pos].RSSI[router_pos] = receive->payload_data[1];
                    end_device[emergency_node_pos].last_seq = seq; 
                }
                break;
            default:
                break;
        }
    }
    else check_emergency();
}




